import React, { useState, useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import './Home.css';

const Home = () => {
  const [currentSlide, setCurrentSlide] = useState(0);

  const galleryImages = [
    "https://c8.alamy.com/comp/2Y6J13A/children-playing-in-sports-ground-ilam-primary-school-ilam-road-ilam-christchurch-tautahi-canterbury-new-zealand-2Y6J13A.jpg",
    "https://www.informalnewz.com/wp-content/uploads/2024/03/School-Holidays-2024-25-1068x712.jpg",
    "https://images.unsplash.com/photo-1523240795612-9a054b0db644?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60",
    "https://i.pinimg.com/originals/34/98/db/3498dbc6115affa62dd20771cef4eb2d.jpg",
    "https://images.unsplash.com/photo-1560785496-3c9d27877182?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60",
    "https://images.unsplash.com/photo-1577896851231-70ef18881754?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"
  ];

  useEffect(() => {
    AOS.init({
      duration: 1000,
      easing: 'ease-in-out',
      once: true,
    });
  }, []);

  return (
    <div className="home">
      {/* Gallery Section */}
      <section className="gallery-section">
        <div className="container">
          <h2 className="section-title" data-aos="fade-up">School Gallery</h2>
          <div className="gallery-grid">
            {galleryImages.map((image, index) => (
              <div
                key={index}
                className="gallery-item"
                data-aos="zoom-in"
                data-aos-delay={index * 100}
              >
                <img src={image} alt={`Gallery ${index + 1}`} />
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
